import React from "react";

import { Link } from "react-router-dom";

const navBar = () => {
  return (
    <div>
      <button>
        <Link to="/">Home</Link>
      </button>
      <button>
        <Link to="/informationen">Informationen</Link>
      </button>
      <button>
        <Link to="/statistik">Statistik</Link>
      </button>
    </div>
  );
};

export default navBar;
